import React, { useState } from 'react';
import { Button, TextField, Box, Typography } from '@mui/material';
import axios from 'axios';

const ServicesPage = () => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [service, setService] = useState('');
  const [message, setMessage] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();

    // Отправляем данные на сервер
    axios.post('/api/order', { name, email, service, message })
      .then((response) => {
        alert('Ваш заказ успешно отправлен!');
      })
      .catch((error) => {
        console.error('Ошибка отправки данных:', error);
      });
  };

  return (
    <div>
      <Typography variant="h4" gutterBottom>Услуги компании</Typography>
      
      {/* Таблица с услугами */}
      <Box sx={{ padding: 3 }}>
        <table style={{ width: '100%', borderCollapse: 'collapse' }}>
          <thead>
            <tr>
              <th style={{ border: '1px solid #ddd', padding: '8px' }}>Услуга</th>
              <th style={{ border: '1px solid #ddd', padding: '8px' }}>Цена</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td style={{ border: '1px solid #ddd', padding: '8px' }}>Разработка ПО</td>
              <td style={{ border: '1px solid #ddd', padding: '8px' }}>50000 ₽</td>
            </tr>
            <tr>
              <td style={{ border: '1px solid #ddd', padding: '8px' }}>Поддержка и обслуживание</td>
              <td style={{ border: '1px solid #ddd', padding: '8px' }}>20000 ₽</td>
            </tr>
            <tr>
              <td style={{ border: '1px solid #ddd', padding: '8px' }}>Интеграция с кассами</td>
              <td style={{ border: '1px solid #ddd', padding: '8px' }}>15000 ₽</td>
            </tr>
          </tbody>
        </table>
      </Box>

      <Typography variant="h5" gutterBottom>Форма заказа услуги</Typography>

      {/* Форма для заказа услуги */}
      <form onSubmit={handleSubmit}>
        <TextField
          label="Ваше имя"
          variant="outlined"
          fullWidth
          margin="normal"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
        <TextField
          label="Ваш Email"
          variant="outlined"
          fullWidth
          margin="normal"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
        />
        <TextField
          label="Услуга"
          variant="outlined"
          fullWidth
          margin="normal"
          value={service}
          onChange={(e) => setService(e.target.value)}
        />
        <TextField
          label="Сообщение"
          variant="outlined"
          fullWidth
          margin="normal"
          multiline
          rows={4}
          value={message}
          onChange={(e) => setMessage(e.target.value)}
        />

        <Button type="submit" variant="contained" color="primary" sx={{ marginTop: '16px' }}>
          Заказать услугу
        </Button>
      </form>
    </div>
  );
};

export default ServicesPage;
